function autocomplete(inp, arr) {
    /*the autocomplete function takes two arguments,
    the text field element and an array of possible autocompleted values:*/
    let currentFocus;
    /*execute a function when someone writes in the text field:*/
    inp.addEventListener("input", function(x) {
        let a, b, i, val = this.value;
        /*close any already open lists of autocompleted values*/
        closeAllLists();
        if (!val) { return false;}
        currentFocus = -1;
        /*create a DIV element that will contain the items (values):*/
        a = document.createElement("DIV");
        a.setAttribute("id", this.id + "autocomplete-list");
        a.setAttribute("class", "autocomplete-items");
        a.classList.add("bg-secondary-lighten-2", "px-1", "pb-1", "rounded");
        /*append the DIV element as a child of the autocomplete container:*/
        this.parentNode.appendChild(a);
        /*for each item in the array...*/
        const maxCount = 5;

        let stockCount = 0;
        let ws = document.createElement("DIV");
        ws.classList.add("mt-3");
        ws.classList.add("bg-transparent");
        ws.innerHTML = "<h6 class='mt-1'>STOCK TICKERS</h6>";
        a.appendChild(ws);

        let w = document.createElement("DIV");
        w.classList.add("rounded");
        a.appendChild(w);
        for (let i in autoCompleteMetadata.StocksMap) {
            let stockTicker = autoCompleteMetadata.StocksMap[i];
            if (stockCount >= maxCount) {
                break;
            }

            if (stockTicker.substr(0, val.length).toUpperCase() === val.toUpperCase()) {
                stockCount += 1;
                b = document.createElement("DIV");
                b.classList.add("border-0");
                /*make the matching letters bold:*/
                b.innerHTML = "<button type='button' style='margin-left: 1em' class='btn my-1 btn-outline-success btn-sm'>" + "<strong>" + stockTicker.substr(0, val.length) + "</strong>" +
                stockTicker.substr(val.length)
                + "</button>";
                /*insert an input field that will hold the current array item's value:*/
                b.innerHTML += "<input type='hidden' value='" + stockTicker + "'>";
                /*execute a function when someone clicks on the item value (DIV element):*/
                b.addEventListener("click", function(e) {
                    window.location.href = "/stock-summary/" + this.getElementsByTagName("input")[0].value + ".html";
                });
                w.appendChild(b);
            }
        }

        // ETF search
        let etfCount = 0;
        let es = document.createElement("DIV");
        es.classList.add("mt-3");
        es.classList.add("bg-transparent");
        es.innerHTML = "<h6 class=''>ETFs</h6>";
        a.appendChild(es);

        let e = document.createElement("DIV");
        e.classList.add("rounded");
        a.appendChild(e);
        for (let i in autoCompleteMetadata.AccountMap) {
            let etfTicker = autoCompleteMetadata.AccountMap[i];
            if (etfCount >= maxCount) {
                break;
            }

            if (etfTicker.substr(0, val.length).toUpperCase() === val.toUpperCase()) {
                etfCount += 1;
                b = document.createElement("DIV");
                /*make the matching letters bold:*/
                b.innerHTML = "<button type='button' style='margin-left: 1em' class='btn my-1 btn-outline-primary btn-sm'>" + "<strong>" + etfTicker.substr(0, val.length) + "</strong>" +
                    etfTicker.substr(val.length)
                    + "</button>";
                /*insert an input field that will hold the current array item's value:*/
                b.innerHTML += "<input type='hidden' value='" + etfTicker + "'>";
                /*execute a function when someone clicks on the item value (DIV element):*/
                b.addEventListener("click", function(e) {
                    window.location.href = "/etf-summary/" + this.getElementsByTagName("input")[0].value + ".html";
                });
                e.appendChild(b);
            }
        }
    });
    /*execute a function presses a key on the keyboard:*/
    inp.addEventListener("keydown", function(e) {
        let x = document.getElementById(this.id + "autocomplete-list");
        if (x) x = x.getElementsByTagName("div");
        if (e.keyCode === 40) {
            /*If the arrow DOWN key is pressed,
            increase the currentFocus variable:*/
            currentFocus++;
            /*and make the current item more visible:*/
            addActive(x);
        } else if (e.keyCode === 38) { //up
            /*If the arrow UP key is pressed,
            decrease the currentFocus variable:*/
            currentFocus--;
            /*and make the current item more visible:*/
            addActive(x);
        } else if (e.keyCode === 13) {
            /*If the ENTER key is pressed, prevent the form from being submitted,*/
            e.preventDefault();
            if (currentFocus > -1) {
                /*and simulate a click on the "active" item:*/
                if (x) x[currentFocus].click();
            }
        }
    });
    function addActive(x) {
        /*a function to classify an item as "active":*/
        if (!x) return false;
        /*start by removing the "active" class on all items:*/
        removeActive(x);
        if (currentFocus >= x.length) currentFocus = 0;
        if (currentFocus < 0) currentFocus = (x.length - 1);
        /*add class "autocomplete-active":*/
        x[currentFocus].classList.add("autocomplete-active");
    }
    function removeActive(x) {
        /*a function to remove the "active" class from all autocomplete items:*/
        for (let i = 0; i < x.length; i++) {
            x[i].classList.remove("autocomplete-active");
        }
    }
    function closeAllLists(elmnt) {
        /*close all autocomplete lists in the document,
        except the one passed as an argument:*/
        const x = document.getElementsByClassName("autocomplete-items");
        for (let i = 0; i < x.length; i++) {
            if (elmnt !== x[i] && elmnt !== inp) {
                x[i].parentNode.removeChild(x[i]);
            }
        }
    }
    /*execute a function when someone clicks in the document:*/
    document.addEventListener("click", function (e) {
        closeAllLists(e.target);
    });
}

